// Inside Dashboard.js
import React from 'react';
import { View, Text } from 'react-native';

const Dashboard = () => {
    return (
        <View>
            <Text>Dashboard</Text>
            {/* Your dashboard content */}
        </View>
    );
};

export default Dashboard;
